import Hello from "./components/Hello";
import Navbar from "./components/Navbar";
import TopBar from './components/TopBar';

function App() {
  return (
    <div>
      <Navbar />
      <h1 className="text-center mt-6 text-2xl">Welcome to My Website</h1>
      <Hello />
    </div>
  );
}

export default App;
